	abp: function(){
		var tuo = JSON.parse(localStorage.getItem('t_userObject') || '{}');
		var abp = JSON.parse(localStorage.getItem('abp') || '{}');
		if(tuo && tuo.lds_acct && !abp.account)
			abp.account = !!tuo.lds_acct

		if(document.referrer.indexOf('https://ident.lds.org/sso/UI/Login') != -1)
			fetch('https://www.lds.org/header')
			.then(function(r){
				r.text().then(function(html){
					var parts = html.split('\n').filter(function(r){return r.trim().length});
					var tagMap = [{
						name: 'c',
						selector: 'policy-ldspositions',
						convert: function(v){
							v = v || '';
							return v.split(':').map(function(c){
								return c.split('/')[0];
							})
						}
					},{
						name: 'm',
						selector: 'policy-ldsaccountid',
						convert: function(v){
							return !!v;
						}
					},{
						name: 'g',
						selector: 'policy-gender',
						convert: function(v){
							var map = {M:1,F:2}
							return map[v]
						}
					}]
					tagMap.forEach(function(t){
						t.value = parts.find(function(p){return p.indexOf(t.selector) != -1});
						t.value = t.value.split('</b> ')[1].replace('<br>', '');
						if(t.convert)
							abp[t.name] = t.convert(t.value);
						else
							abp[t.name] = t.value;
					})
					localStorage.setItem('abp', JSON.stringify(abp))
				})
			}).catch(function(e){

			})
		var tld = window.location.host;
		abp[tld] = abp[tld] || 0;
		abp[tld]++;
		localStorage.setItem('abp', JSON.stringify(abp))
		window.ABP = function(k,v){
			var abp = JSON.parse(localStorage.getItem('abp') || '{}');
			if(v==undefined){
				return abp[k];
			}else{
				abp[k]=v;
				localStorage.setItem('abp', JSON.stringify(abp))
			}
		}
	},
	urlParam: function(key){
		var vars = {};
		var parts = window.location.href.replace(/[?&]+([^=&]+)=([^&]*)/gi, function(m,k,value) {
			vars[k] = value;
		});
		return key ? vars[key] : vars
	},
	abCheck: function(){
		var exp = new Date();
		var time = exp.getTime();
		var expireTime = time + 1000*60*60;
		exp.setTime(expireTime);

		var projects = aTools.urlParam('abProjects');
		var version = aTools.urlParam('abVersion');
		if(version)
			document.cookie = "abVersion="+ (version=='clear' ? '' : version)+';expires='+exp.toGMTString()+';';
		if(projects)
			document.cookie = "abProjects='"+(projects=='clear' ? '' : projects)+"'"+';expires='+exp.toGMTString()+';';
	}
}
aTools.abCheck();

